(24, 3, 'Diagrama de Classe', '', 'Diagrama de Classe\r\nOBJETIVO C\r\nEste diagrama de classe representa uma rede social, abrangendo usurios, administradores, publicaes, comentrios, notificaes e\r\neventos. Destaques incluem a herana de propriedades de Usuario para Administrador, operaes administrativas como bloquear e\r\nbanir usurios, relacionamentos entre usurios, eventos e publicaes, e operaes de usurio como adicionar amigos e criar\r\npublicaes. O diagrama oferece uma viso abrangente da estrutura e interaes na rede social.', 'S', 'N', '', '12:09', '2023-11-26', '65050-72', 'So Lus', 'MA', 'Rua Eider Pestana', 123, 'COHAB Anil II');
INSERT INTO `events` (`id`, `user_id`, `titulo`, `imagem`, `descricao`, `flag_ativo`, `flag_promocao`, `desc_promocao`, `horario`, `data`, `cep`, `cidade`, `uf`, `rua`, `numero`, `bairro`) VALUES
(25, 3, 'Diagrama Caso de Uso', '', '  ', 'S', 'N', '', '12:11', '2023-11-26', '77420-75', 'Gurupi', 'TO', 'Rua 23', 123, 'Parque Residencial Nova Fronteira');
INSERT INTO `events` (`id`, `user_id`, `titulo`, `imagem`, `descricao`, `flag_ativo`, `flag_promocao`, `desc_promocao`, `horario`, `data`, `cep`, `cidade`, `uf`, `rua`, `numero`, `bairro`) VALUES
(26, 3, 'Diagrama de Sequencia Publicao', '', 'Diagrama de Sequencia Publicao\r\nEste diagrama representa a sequncia de interaes entre o usurio (Usuario), o sistema (Sistema) e o banco de dados\r\n(Banco Dados) durante o processo de criao de uma publicao. Cada seta indica uma mensagem enviada entre os\r\nparticipantes, e as linhas de vida mostram a ativao e desativao dos participantes ao longo do tempo.', 'S', 'N', '', '12:13', '2023-11-26', '92022-08', 'Canoas', 'RS', 'Rua Irlanda', 123, 'Marechal Rondon'),
(27, 3, 'Diagrama de Sequencia Cadastro', '', 'Diagrama de Sequencia Cadastro\r\nEste diagrama de sequncia representa a interao entre o usurio (Usuario), o sistema (Sistema) e o banco de dados\r\n(Banco Dados) durante o processo de fazer um cadastro em uma rede social. Cada mensagem entre os participantes \r\nindicada por uma seta, e as linhas de vida mostram a ativao e desativao dos participantes ao longo do tempo.', 'S', 'S', '1. **Usurio Inicia o Processo:**\r\n- Acessa a tela de cadastro na interface da rede\r\nsocial.\r\n<br/>\r\n2. **Sistema Solicita Informaes:**\r\n- Solicita ao usurio as informaes necessrias para\r\no cadastro, como nome, email e senha.\r\n<br/>\r\n3. **Usurio Fornece Informaes:**\r\n- Preenche os campos obrigatrios com suas\r\ninformaes.\r\n<br/>\r\n4. **Verificao de Disponibilidade de Email:**\r\n- O sistema verifica se o email fornecido pelo usurio\r\nest disponvel.\r\n<br/>\r\n- **Sucesso:**\r\n- O email est disponvel para cadastro.\r\n<br/>\r\n- **Alternativa:**\r\n- Notifica o usurio se o email j estiver registrado.\r\n<br/>\r\n5. **Criao de Conta no Banco de Dados:**\r\n- Se o email estiver disponvel, o sistema cria uma\r\nnova conta associada ao email no banco de dados.\r\n<br/>\r\n6. **Gerao de Perfil Padro:**\r\n- O sistema gera um perfil padro para o novo\r\nusurio, incluindo configuraes iniciais.\r\n<br/>\r\n7. **Confirmao de Cadastro:**\r\n- O sistema exibe uma mensagem de confirmao de\r\ncadastro bem-sucedido.\r\n<br/>\r\n8. **Redirecionamento para Pgina Inicial:**\r\n- Redireciona o usurio para a pgina inicial da rede\r\nsocial, pronto para realizar login.', '12:15', '2023-11-26', '59063-10', 'Natal', 'RN', 'Avenida Jernimo Cmara', 123, 'Lagoa Nova');
INSERT INTO `events` (`id`, `user_id`, `titulo`, `imagem`, `descricao`, `flag_ativo`, `flag_promocao`, `desc_promocao`, `horario`, `data`, `cep`, `cidade`, `uf`, `rua`, `numero`, `bairro`) VALUES
(28, 3, 'Diagrama de Sequencia Evento', '', 'Diagrama de Sequencia Evento\r\nO usurio solicita a criao de um evento.\r\nO sistema verifica as permisses do usurio no banco de dados.\r\nSe as permisses so verificadas com sucesso, o sistema cria um novo evento no banco de dados.\r\nEm caso de sucesso, o sistema notifica os participantes do evento atravs de um servio de notificao.\r\nSe a notificao for bem-sucedida, o sistema confirma a criao do evento para o usurio.\r\nSe houver uma falha ao criar o evento, o sistema envia uma mensagem de erro para o usurio.', 'S', 'S', '1. **Usurio Inicia o Processo:**\r\n- Acessa a tela de criao de evento.\r\n<br/>\r\n2. **Sistema Solicita Detalhes do Evento:**\r\n- Solicita e usurio fornece informaes do evento.\r\n<br/>\r\n3. **Verificao de Permisses:**\r\n- Verifica se o usurio tem permisses para criar\r\neventos.\r\n<br/>\r\n4. **Criao de Evento:**\r\n- Se o usurio tem permisses, o sistema cria o\r\nevento.\r\n<br/>\r\n5. **Notificao de Participantes:**\r\n- Notifica os participantes potenciais.\r\n<br/>\r\n6. **Confirmao e Redirecionamento:**\r\n- Exibe confirmao e redireciona para a pgina do\r\nevento.', '12:18', '2023-11-26', '59063-10', 'Natal', 'RN', 'Avenida Jernimo Cmara', 123, 'Lagoa Nova');
INSERT INTO `events` (`id`, `user_id`, `titulo`, `imagem`, `descricao`, `flag_ativo`, `flag_promocao`, `desc_promocao`, `horario`, `data`, `cep`, `cidade`, `uf`, `rua`, `numero`, `bairro`) VALUES
(29, 3, 'Diagrama de Sequencia Senha', '', 'Diagrama de Sequencia Senha\r\nO usurio solicita a redefinio de sua senha.\r\nO sistema verifica a existncia do email no banco de dados.\r\nSe o email  encontrado, o sistema gera um token de redefinio de senha.\r\nO sistema armazena o token no banco de dados.\r\nO sistema envia um email com instrues de redefinio para o usurio.\r\nO usurio recebe a confirmao da solicitao de redefinio de senha.', 'S', 'S', '1. **Usurio Inicia o Processo:**\r\n- Acessa a tela de recuperao de senha.\r\n<br/>\r\n2. **Sistema Solicita Email:**\r\n- Solicita que o usurio insira o email associado  conta.\r\n<br/>\r\n3. **Usurio Fornece Email:**\r\n- Insere o email e solicita a redefinio de senha.\r\n<br/>\r\n4. **Verificao de Email no Banco de Dados:**\r\n- Verifica a existncia do email.\r\n<br/>\r\n- **Sucesso:**\r\n- Gera um token de redefinio associado ao email.\r\n<br/>\r\n- **Alternativa:**\r\n- Notifica se o email no estiver registrado.\r\n<br/>\r\n5. **Envio de Email com Instrues:**\r\n- Envia email contendo instrues e token.\r\n<br/>\r\n- **Sucesso:**\r\n- Exibe mensagem de envio bem-sucedido.\r\n<br/>\r\n- **Alternativa:**\r\n- Exibe mensagem de erro em caso de falha.\r\n<br/>\r\n6. **Usurio Recebe Instrues por Email:**\r\n- Recebe email e decide seguir as instrues.\r\n<br/>\r\n7. **Confirmao de Solicitao pelo Usurio:**\r\n- Aguarda confirmao do usurio.\r\n<br/>\r\n- **Sucesso:**\r\n- Redireciona para pgina de nova senha.\r\n<br/>\r\n- **Alternativa:**\r\n- Permite nova tentativa.\r\n<br/>\r\n8. **Atualizao da Senha:**\r\n- Insere nova senha e confirma atualizao.\r\n<br/>\r\n- **Sucesso:**\r\n- Exibe mensagem de confirmao e redireciona para tela\r\nde login.\r\n<br/>\r\n- **Alternativa:**\r\n- Exibe mensagem de erro em caso de falha', '12:21', '2023-11-26', '87053-11', 'Maring', 'PR', 'Rua Manoel Lopes', 123, 'Conjunto Joo de Barro I');

